BEGIN TRANSACTION;
CREATE TABLE "files" (
	`file_id`	TEXT,
	`file_path`	TEXT,
	`file_type`	TEXT,
	`key_type`	TEXT
);
CREATE TABLE "docs" (
	`parent`	TEXT,
	`annotation`	TEXT,
	`text`	TEXT,
	`study_link`	TEXT,
	`study_data`	TEXT,
	`study_title`	TEXT,
	`free_text`	TEXT,
	`selectable`	INTEGER,
	PRIMARY KEY(`annotation`)
);

Data were downloaded in R format. We included only intervals overlapping with DNaseI regions selected with -log10(p) >= 10. 

Information about the interpretation of each of the 25 states can be found here: http://egg2.wustl.edu/roadmap/web_portal/imputed.html#chr_imp. 

The name for each cell type can be found here: https://docs.google.com/spreadsheets/u/1/d/1yikGx4MsO9Ei36b64yOy9Vb6oPC5IBGlFbYEt-N6gOM/edit?usp=sharing#gid=15.',0),
 ('va.chromHMM','va.chromHMM.enhancers','Enhancers',NULL,NULL,NULL,'Enhancers states included: 10, 11, 12, 13, 14, 15, 16, 17, 18. Strong enhancers usually defined: 10, 12, 13, 14, 15. 0=no enhancer.',1),
 ('va.chromHMM','va.chromHMM.promoters','Promoters',NULL,NULL,NULL,'Promoters + TSS states included: 1, 2, 3, 4, 22, 23. Strong promoters + TSS usually defined: 1, 2, 3, 4. 1=TSS, 0=no promoters, TSS.',1),
 ('va','va.dann','DANN','https://www.ncbi.nlm.nih.gov/pubmed/25338716','https://cbcl.ics.uci.edu/public_data/DANN/data/','Quang, Daniel, Yifei Chen, and Xiaohui Xie. "DANN: A Deep Learning Approach for Annotating the Pathogenicity of Genetic Variants." Bioinformatics 31.5 (2015): 761-763.','Same as CADD, but using a deep learning approach.',0),
 ('va','va.dbNSFP','dbNSFP v2.9.3','https://www.ncbi.nlm.nih.gov/pubmed/?term=26555599','ftp://dbnsfp:dbnsfp@dbnsfp.softgenetics.com/dbNSFPv2.9.3.zip','Liu, Xiaoming et al. "dbNSFP v3.0: A One-Stop Database of Functional Predictions and Annotations for Human Non-Synonymous and Splice Site SNVs." Human mutation 37.3 (2016): 235-241.','Database for Nonsynonymous SNPs'' functional predictions, v2.9.3.

The dbNSFP is an integrated database of functional annotations from multiple sources for the comprehensive collection of human non-synonymous SNPs (NSs).

Its current version includes a total of 87,361,054 NSs. It compiles prediction scores from 14 prediction algorithms (SIFT, Polyphen2, LRT, MutationTaster, MutationAssessor, FATHMM, MetaSVM, MetaLR, CADD, VEST, PROVEAN, M-CAP, Eigen\uff0cEigen PC), eight conservation scores (phyloP46way_primate, phyloP46way_placental, phyloP100way_vertebrate, phastCons46way_primate, phastCons46way_placental, phastCons100way_veterbrate, GERP++, and SiPhy) and other function annotations.

We included all the original annotations except for allele frequencies in 1000 genome and ExAC since these are covered in other annotations.

Note 1: Missing data is designated as ".".
Note 2: The three Uniprot entries are based on Polyphen-2 v2.2.2 annotations.',0),
 ('va','va.dhs','Replicated DHS','http://biorxiv.org/content/early/2016/05/19/054361','Shared by pshoosh@broadinstitute.org','Shooshtari et Al. Integrative genetic and epigenetic analysis uncovers regulatory mechanisms of autoimmune disease','Detailed information about the processing are available https://storage.googleapis.com/annotationdb/dhs/Replicable-DHS.pdf',0),
 ('va','va.discovEHR','DiscovEHR','https://www.ncbi.nlm.nih.gov/pubmed/28008009','http://www.discovehrshare.com/downloads','Distribution and clinical impact of functional variants in 50,726 whole-exome sequences from the DiscovEHR study. Science (2016).',NULL,0),
 ('va','va.eigen','EIGEN','https://www.ncbi.nlm.nih.gov/pubmed/26727659','https://xioniti01.u.hpc.mssm.edu/v1.1/','IONITA-LAZA, IULIANA et al. "A SPECTRAL APPROACH INTEGRATING FUNCTIONAL GENOMIC ANNOTATIONS FOR CODING AND NONCODING VARIANTS." Nature genetics 48.2 (2016): 214-220.','EIGEN v1.1. In the paper, Eigen PC works better than EIGEN in non-coding regions.',0),
 ('va','va.fantom5','FANTOM 5','https://www.ncbi.nlm.nih.gov/pubmed/?term=24670763','http://enhancer.binf.ku.dk/presets/robust_enhancers.bed and http://enhancer.binf.ku.dk/presets/permissive_enhancers.bed','Andersson, Robin et al. “An Atlas of Active Enhancers across Human Cell Types and Tissues.” Nature 507.7493 (2014): 455–461.','FANTOM5 enhancers obtained with CAGE technique',0),
 ('va','va.funseq2','FUNSEQ 2','https://www.ncbi.nlm.nih.gov/pubmed/25273974','http://archive.gersteinlab.org/funseq2.1.2/hg19_NCscore_funseq216.tsv.bgz','Fu, Yao et al. “FunSeq2: A Framework for Prioritizing Noncoding Regulatory Variants in Cancer.” Genome Biology 15.10 (2014): 480. PMC. Web. 19 June 2017.','FUNSEQ 2 is an approach developed for prioritizing somatic cancer mutations.',0),
 ('va','va.gencode19','GENCODE v19',NULL,NULL,NULL,'These files were obtained from UCSC table browser with these settings: Assembly: Feb. 2009 (GRCh37/hg19), Group: Genes and Gene Predictions, Track: GENCODE Genes V19, Region:  genome, Output: format: BED',0),
 ('va','va.gene','Gene-level annotations',NULL,NULL,NULL,'These gene-level annotations can be used to annotate variants in a VDS by specifying a single gene symbol for each variant. 

This gene key is used to map each variant to the appropriate gene-level annotations.

By default, VEP is run and its output is parsed to extract the gene key (see more detailed description on the bottom of this page).',0),
 ('va.gene','va.gene.names','Gene names','https://www.ncbi.nlm.nih.gov/pubmed/?term=26555599','ftp://dbnsfp:dbnsfp@dbnsfp.softgenetics.com/dbNSFPv2.9.3.zip','Liu, Xiaoming et al. "dbNSFP v3.0: A One-Stop Database of Functional Predictions and Annotations for Human Non-Synonymous and Splice Site SNVs."','Part of the dbnsfp database contains gene-level annotations. The original file is called dbNSFP2.9_gene. We include here few annotations that allow to exchange gene names across databases.',1),
 ('va.gene','va.gene.constraint','Gene constraint scores','https://www.ncbi.nlm.nih.gov/pubmed/27535533','ftp://ftp.broadinstitute.org/pub/ExAC_release/release0.3.1/functional_gene_constraint','Exome Aggregation Consortium et al. “Analysis of Protein-Coding Genetic Variation in 60,706 Humans.” Nature 536.7616 (2016): 285–291.','Detailed description of the content of these scores is provided at: ftp://ftp.broadinstitute.org/pub/ExAC_release/release0.3.1/functional_gene_constraint. 

No TGCA: exclude TGCA samples, No psych: exclude samples with psychiatric disorders',1),
 ('va','va.gnomAD','gnomAD','https://www.ncbi.nlm.nih.gov/pubmed/27535533','http://gnomad.broadinstitute.org/downloads','Exome Aggregation Consortium et al. "Analysis of Protein-Coding Genetic Variation in 60,706 Humans." Nature 536.7616 (2016): 285-291.','The Genome Aggregation Database (gnomAD) is a resource developed by an international coalition of investigators, with the goal of aggregating and harmonizing both exome and genome sequencing data from a wide variety of large-scale sequencing projects, and making summary data available for the wider scientific community.

The data set provided on this website spans 123,136 exome sequences and 15,496 whole-genome sequences from unrelated individuals sequenced as part of various disease-specific and population genetic studies. 

The gnomAD Principal Investigators and groups that have contributed data to the current release are listed <a href=\"http://gnomad.broadinstitute.org/about\" target=\"_blank\">here</a>.\n\nAll data here are released for the benefit of the wider biomedical community, without restriction on use - see the terms of use <a href=\"http://gnomad.broadinstitute.org/terms\" target=\"_blank\">here</a>.',0),
 ('va.gnomAD','va.gnomAD.exomes','Exomes',NULL,NULL,NULL,'Annotations generated from 123,136 whole exome sequences in gnomAD.',1),
 ('va.gnomAD','va.gnomAD.genomes','Genomes',NULL,NULL,NULL,'Annotations generated from 15,496 whole genome sequences in gnomAD.',1),
 ('va','va.isLCR','Low-complexity regions','https://www.ncbi.nlm.nih.gov/pubmed/?term=24974202','https://github.com/lh3/varcmp/blob/master/scripts/LCR-hs37d5.bed.gz','Li, Heng. “Toward Better Understanding of Artifacts in Variant Calling from High-Coverage Samples.” Bioinformatics 30.20 (2014): 2843–2851.','Regions with repeated sequences normally excluded from WGS studies',1),
 ('va','va.ldscore','LD SCORE Annotations','https://www.ncbi.nlm.nih.gov/pubmed/?term=26414678','https://data.broadinstitute.org/alkesgroup/LDSCORE/baseline_bedfiles.tgz','Finucane, Hilary K. et al. “Partitioning Heritability by Functional Annotation Using Genome-Wide Association Summary Statistics.” Nature genetics 47.11 (2015): 1228–1235. PMC. Web. 19 June 2017.','Set of annotations used for LDSCORE partitioning heritability. Info for each annotation are available in the original publication.',0),
 ('va','va.linsight','LINSIGHT','http://www.nature.com/ng/journal/v49/n4/full/ng.3810.html','http://compgen.cshl.edu/~yihuang/tracks/LINSIGHT.bw','Huang, Yi-Fei, Brad Gulko, and Adam Siepel. "Fast, scalable prediction of deleterious noncoding variants from functional and population genomic data" Nature Genetics. Online.','We tranformed the .bw data into .bed format using this program: http://hgdownload.soe.ucsc.edu/admin/exe/linux.x86_64/bigWigToBedGraph',0),
 ('va','va.segway','SEGWAY','http://biorxiv.org/content/early/2016/11/07/086025','http://noble.gs.washington.edu/proj/encyclopedia/segway_encyclopedia.bed.gz','A unified encyclopedia of human functional elements through fully automated annotation of 164 human cell types. Biorxiv.','Data were imported as it is from the website. The sum of functionality score, the average base-wise functionality score and the majority label of each cell type in the segment are reported. Information about the interpretation of each label can be found here: http://noble.gs.washington.edu/proj/encyclopedia/',0),
 ('va','va.tfbs','Transcription factor binding sites',NULL,'http://hgdownload.cse.ucsc.edu/goldenPath/hg19/encodeDCC/wgEncodeRegTfbsClustered/wgEncodeeRegTfbsClusteredV3.bed.gz',NULL,'Transcription factor binding sites obtained from V3 of ENCODE and downloaded from UCSC browser. The track is described here: http://genome.ucsc.edu/cgi-bin/hgTrackUi?db=hg19&g=wgEncodeRegTfbsClusteredV3',0),
 ('va','va.vep','Variant Effect Predictor (VEP)','https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4893825/','http://grch37.ensembl.org/Homo_sapiens/Tools/VEP','McLaren, William et al. "The Ensembl Variant Effect Predictor." Genome Biology 17 (2016): 122.','Variant Effect Predictor (VEP) with Loss-Of-Function Transcript Effect Estimator (LOFTEE) plug-in.',1),
 ('va','va.vista','VISTA','https://www.ncbi.nlm.nih.gov/pubmed/?term=17130149','https://enhancer.lbl.gov/cgi-bin/imagedb3.pl?page_size=20000;show=1;search.result=yes;form=search;search.form=no;action=search;search.sequence=1','Visel, Axel et al. “VISTA Enhancer Browser—a Database of Tissue-Specific Human Enhancers.” Nucleic Acids Research 35.Database issue (2007): D88–D92.','Validated enhancers from VISTA. We select only positive human elements. 

Once downloaded, 2APR2017, the data were processed as follows: 

''grep \">Human\" vista_2APR2017.txt | grep \"positive\" | awk ''{split($0,a,\"|\"); print a[2], a[5]}'' > vista_2APR2017_processed.txt''

More info available here: https://enhancer.lbl.gov/aboutproject_n.html.',0),
 ('','va','','','','','','');
CREATE TABLE `array_elements` (
	`annotation`	TEXT,
