	`element_type`	TEXT
);
CREATE TABLE "annotations" (
	`file_id`	TEXT,
	`parent`	TEXT,
	`annotation`	TEXT,
	`file_element`	TEXT,
	`type`	TEXT,
	`description`	TEXT,
	PRIMARY KEY(`annotation`)
);
COMMIT;
