 ('f_0004','va.dbNSFP','va.dbNSFP.aaref','aaref','String','reference amino acid; "." if the variant is a splicing site SNP (2bp on each end of an intron)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.aaalt','aaalt','String','alternative amino acid; "." if the variant is a splicing site SNP (2bp on each end of an intron)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.rs_dbsnp147','rs_dbsnp147','String','rs number from dbSNP 147'),
 ('f_0004','va.dbNSFP','va.dbNSFP.hg18_pos','hg18_pos','String','physical position on the chromosome as to hg18 (1-based coordinate)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.hg38_chr','hg38_chr','String','chromosome as to hg38, "." means the same as in the chr column'),
 ('f_0004','va.dbNSFP','va.dbNSFP.hg38_pos','hg38_pos','String','physical position on the chromosome as to hg38 (1-based coordinate)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.genename','genename','String','gene name; if the NScan be assigned to multiple genes, gene names are separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.uniprot_acc','uniprot_acc','String','Uniprot accession number. Multiple entries separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.uniprot_id','uniprot_id','String','Uniprot ID number. Multiple entries separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.uniprot_aapos','uniprot_aapos','String','amino acid position as to Uniprot. Multiple entries separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.interpro_domain','interpro_domain','String','domain or conserved site on which the variant locates. Domain annotations come from Interpro database. The number in the brackets following a specific domain is the count of times Interpro assigns the variant position to that domain, typically coming from different predicting databases. Multiple entries separated by ";".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.cds_strand','cds_strand','String','coding sequence (CDS) strand (+ or -)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.refcodon','refcodon','String','reference codon'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SLR_test_statistic','SLR_test_statistic','String','SLR test statistic for testing natural selection on codons. A negative value indicates negative selection, and a positive value indicates positive selection. Larger magnitude of the value suggests stronger evidence.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.codonpos','codonpos','String','position on the codon (1, 2 or 3)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.fold_degenerate','fold_degenerate','String','degenerate type (0, 2 or 3)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.ancestral_allele','ancestral_allele','String','Ancestral allele (based on 1000 genomes reference data). The following comes from its original README file: ACTG - high-confidence call, ancestral state supproted by the other two sequences; actg - low-confindence call, ancestral state supported by one sequence only; N - failure, the ancestral state is not supported by any other sequence; - - the extant species contains an insertion at this postion; . - no coverage in the alignment'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Ensembl_geneid','Ensembl_geneid','String','Ensembl gene id'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Ensembl_transcriptid','Ensembl_transcriptid','String','Ensembl transcript ids (separated by ";")'),
 ('f_0004','va.dbNSFP','va.dbNSFP.aapos','aapos','String','amino acid position as to the protein "-1" if the variant is a splicing site SNP (2bp on each end of an intron)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.aapos_SIFT','aapos_SIFT','String','ENSP id and amino acid positions corresponding to SIFT scores. Multiple entries separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.aapos_FATHMM','aapos_FATHMM','String','ENSP id and amino acid positions corresponding to FATHMM scores. Multiple entries separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SIFT_score','SIFT_score','String','SIFT score (SIFTori). Scores range from 0 to 1. The smaller the score the more likely the SNP has damaging effect. Multiple scores separated by ";".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SIFT_converted_rankscore','SIFT_converted_rankscore','String','SIFTori scores were first converted to SIFTnew=1-SIFTori, then ranked among all SIFTnew scores in dbNSFP. The rankscore is the ratio of the rank the SIFTnew score over the total number of SIFTnew scores in dbNSFP. If there are multiple scores,o nly the most damaging (largest) rankscore is presented. The rankscores range from 0.02654 to 0.87932.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SIFT_pred','SIFT_pred','String','If SIFTori is smaller than 0.05 (rankscore>0.55) the corresponding NS is predicted as "D(amaging)"; otherwise it is predicted as "T(olerated)". Multiple predictions separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HDIV_score','Polyphen2_HDIV_score','String','Polyphen2 score based on HumDiv, i.e. hdiv_prob. The score ranges from 0 to 1. Multiple entries separated by ";".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HDIV_rankscore','Polyphen2_HDIV_rankscore','String','Polyphen2 HDIV scores were first ranked among all HDIV scores in dbNSFP. The rankscore is the ratio of the rank the score over the total number of the scores in dbNSFP. If there are multiple scores, only the most damaging (largest) rankscore is presented. The scores range from 0.02656 to 0.89917.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HVAR_score','Polyphen2_HVAR_score','String','Polyphen2 score based on HumVar, i.e. hvar_prob. The score ranges from 0 to 1. Multiple entries separated by \";\".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HVAR_rankscore','Polyphen2_HVAR_rankscore','String','Polyphen2 HVAR scores were first ranked among all HVAR scores in dbNSFP. The rankscore is the ratio of the rank the score over the total number of the scores in dbNSFP. If there are multiple scores, only the most damaging (largest) rankscore is presented. The scores range from 0.01281 to 0.9711.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HVAR_pred','Polyphen2_HVAR_pred','String','Polyphen2 prediction based on HumVar, "D" ("probably damaging", HVAR score in [0.909,1] or rankscore in [0.62955,0.9711]), "P" ("possibly damaging", HVAR in [0.447,0.908] or rankscore in [0.44359,0.62885]) and "B" ("benign", HVAR score in [0,0.446] or rankscore in [0.01281,0.44315]). Score cutoff for binary classification is 0.5 for HVAR score or 0.45998 for rankscore, i.e. the prediction is "neutral" if the HVAR score is smaller than 0.5 (rankscore is smaller than 0.45998), and "deleterious" if the HVAR score is larger than 0.5 (rankscore is larger than 0.45998). Multiple entries are separated by ";".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.LRT_score','LRT_score','String','The original LRT two-sided p-value (LRTori), ranges from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.LRT_converted_rankscore','LRT_converted_rankscore','String','LRTori scores were first converted as LRTnew=1-LRTori*0.5 if Omega<1, or LRTnew=LRTori*0.5 if Omega>=1. Then LRTnew scores were ranked among all LRTnew scores in dbNSFP. The rankscore is the ratio of the rank over the total number of the scores in dbNSFP. The scores range from 0.00166 to 0.85682.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.LRT_pred','LRT_pred','String','LRT prediction, D(eleterious), N(eutral) or U(nknown), which is not solely determined by the score.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationTaster_score','MutationTaster_score','String','MutationTaster p-value (MTori), ranges from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationTaster_converted_rankscore','MutationTaster_converted_rankscore','String','The MTori scores were first converted: if the prediction is "A" or "D" MTnew=MTori; if the prediction is "N" or "P", MTnew=1-MTori. Then MTnew scores were ranked among all MTnew scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of MTnew scores in dbNSFP. The scores range from 0.09067 to 0.80722.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationTaster_pred','MutationTaster_pred','String','MutationTaster prediction, "A" ("disease_causing_automatic"), "D" ("disease_causing"), "N" ("polymorphism") or "P" ("polymorphism_automatic"). The score cutoff between "D" and "N" is 0.5 for MTori and 0.31655 for the rankscore.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationAssessor_score','MutationAssessor_score','String','MutationAssessor functional impact combined score (MAori). The score ranges from -5.135 to 6.49 in dbNSFP. Please refer to Reva et al. (2011) Nucl. Acids Res. 39(17):e118 for details.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationAssessor_rankscore','MutationAssessor_rankscore','String','MAori scores were ranked among all MAori scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of MAori scores in dbNSFP. The scores range from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutationAssessor_pred','MutationAssessor_pred','String','MutationAssessor''s functional impact of a variant : predicted functional, i.e. high ("H") or medium ("M"), or predicted non-functional, i.e. low ("L") or neutral ("N"). The MAori score cutoffs between "H" and "M", "M" and "L", and "L" and "N", are 3.5, 1.935 and 0.8, respectively. The rankscore cutoffs between "H" and "M", "M" and "L", and "L" and "N", are 0.92924, 0.51945 and 0.19692, respectively.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.FATHMM_score','FATHMM_score','String','FATHMM default score (weighted for human inherited-disease mutations with Disease Ontology) (FATHMMori). Scores range from -18.09 to 11.0. The smaller the score the more likely the SNP has damaging effect. Multiple scores separated by ";" Please refer to Shihab et al. (2013) Human Mutation 34(1):57-65 for details.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.FATHMM_rankscore','FATHMM_rankscore','String','FATHMMnew=-FATHMMori scores were ranked among all FATHMMnew scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of FATHMMnew scores in dbNSFP. If there are multiple scores, only the most damaging (smallest) rankscore is presented. The scores range from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.FATHMM_pred','FATHMM_pred','String','If a FATHMMori score is <=-1.5 (or rankscore >=0.81415) the corresponding NS is predicted as "D(AMAGING)"; otherwise it is predicted as "T(OLERATED)". Multiple predictions separated by ";".'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaSVM_score','MetaSVM_score','String','Our support vector machine (SVM) based ensemble prediction score, which incorporated 10 scores (SIFT, PolyPhen-2 HDIV, PolyPhen-2 HVAR, GERP++, MutationTaster, Mutation Assessor, FATHMM, LRT, SiPhy, phyloP) and the maximum frequency observed in the 1000 genomes populations. Larger value means the SNV is more likely to be damaging. Scores range from -2 to 3 in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaSVM_rankscore','MetaSVM_rankscore','String','MetaSVM_rankscore: MetaSVM scores were ranked among all MetaSVM scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of MetaSVM scores in dbNSFP. The scores range from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaSVM_pred','MetaSVM_pred','String','Prediction of our SVM based ensemble prediction score,"T(olerated)" or "D(amaging)". The score cutoff between "D" and "T" is 0. The rankscore cutoff between "D" and "T" is 0.83357.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaLR_score','MetaLR_score','String','Our logistic regression (LR) based ensemble prediction score, which incorporated 10 scores (SIFT, PolyPhen-2 HDIV, PolyPhen-2 HVAR, GERP++, MutationTaster, Mutation Assessor, FATHMM, LRT, SiPhy, phyloP) and the maximum frequency observed in the 1000 genomes populations. Larger value means the SNV is more likely to be damaging. Scores range from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaLR_rankscore','MetaLR_rankscore','String','MetaLR scores were ranked among all MetaLR scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of MetaLR scores in dbNSFP. The scores range from 0 to 1.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MetaLR_pred','MetaLR_pred','String','Prediction of our MetaLR based ensemble prediction score,"T(olerated)" or "D(amaging)". The score cutoff between "D" and "T" is 0.5. The rankscore cutoff between "D" and "T" is 0.82268.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.reliability_index','reliability_index','String','Number of observed component scores (except the maximum frequency in the 1000 genomes populations) for MetaSVM and MetaLR. Ranges from 1 to 10. As MetaSVM and MetaLR scores are calculated based on imputed data, the less missing component scores, the higher the reliability of the scores and predictions.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.VEST3_score','VEST3_score','String','VEST 3.0 score. Score ranges from 0 to 1. The larger the score the more likely the mutation may cause functional change. In case there are multiple scores for the same variant, the largest score (most damaging) is presented. Please refer to Carter et al., (2013) BMC Genomics. 14(3) 1-16 for details. Please note this score is free for non-commercial use. For more details please refer to http://wiki.chasmsoftware.org/index.php/SoftwareLicense. Commercial users should contact the Johns Hopkins Technology Transfer office.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.VEST3_rankscore','VEST3_rankscore','String','VEST3 scores were ranked among all VEST3 scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of VEST3 scores in dbNSFP. The scores range from 0 to 1. Please note VEST score is free for non-commercial use. For more details please refer to http://wiki.chasmsoftware.org/index.php/SoftwareLicense. Commercial users should contact the Johns Hopkins Technology Transfer office.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.PROVEAN_score','PROVEAN_score','String','PROVEAN score (PROVEANori). Scores range from -14 to 14. The smaller the score the more likely the SNP has damaging effect. Multiple scores separated by ";". Details can be found in DOI: 10.1371/journal.pone.0046688'),
 ('f_0004','va.dbNSFP','va.dbNSFP.PROVEAN_converted_rankscore','PROVEAN_converted_rankscore','String','PROVEANori were first converted to PROVEANnew=1-(PROVEANori+14)/28, then ranked among all PROVEANnew scores in dbNSFP. The rankscore is the ratio of the rank the PROVEANnew score over the total number of PROVEANnew scores in dbNSFP. If there are multiple scores, only the most damaging (largest) rankscore is presented.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.PROVEAN_pred','PROVEAN_pred','String','If PROVEANori <= -2.5 (rankscore>=0.59) the corresponding NS is predicted as "D(amaging)"; otherwise it is predicted as "N(eutral)". Multiple predictions separated by ";"'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MCAP_score','MCAP_score','String','M-CAP score (details in DOI: 10.1038/ng.3703). Scores range from 0 to 1. The larger the score the more likely the SNP has damaging effect.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MCAP_rankscore','MCAP_rankscore','String','M-CAP scores were ranked among all M-CAP scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of M-CAP scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MCAP_pred','MCAP_pred','String','Prediction of M-CAP score based on the authors'' recommendation, "T(olerated)" or "D(amaging)". The score cutoff between "D" and "T" is 0.025.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.REVEL_score','REVEL_score','String','REVEL is an ensemble score based on 13 individual scores for predicting the pathogenicity of missense variants. Scores range from 0 to 1. The larger the score the more likely the SNP has damaging effect. "REVEL scores are freely available for non-commercial use. For other uses, please contact Weiva Sieh" (weiva.sieh@mssm.edu)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.REVEL_rankscore','REVEL_rankscore','String','REVEL scores were ranked among all REVEL scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of REVEL scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutPred_score','MutPred_score','String','General MutPred score. Scores range from 0 to 1. The larger the score the more likely the SNP has damaging effect.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutPred_rankscore','MutPred_rankscore','String','MutPred scores were ranked among all MutPred scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of MutPred scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutPred_protID','MutPred_protID','String','UniProt accession or Ensembl transcript ID used for MutPred_score calculation.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutPred_AAchange','MutPred_AAchange','String','Amino acid change used for MutPred_score calculation.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.MutPred_top5features','MutPred_top5features','String','Top 5 features (molecular mechanisms of disease) as predicted by MutPred with p values. MutPred_score > 0.5 and p < 0.05 are referred to as actionable hypotheses. MutPred_score > 0.75 and p < 0.05 are referred to as confident hypotheses. MutPred_score > 0.75 and p < 0.01 are referred to as very confident hypotheses.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.GERP_NR','GERP_NR','String','GERP++ neutral rate'),
 ('f_0004','va.dbNSFP','va.dbNSFP.GERP_RS','GERP_RS','String','GERP++ RS score, the larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.GERP_RS_rankscore','GERP_RS_rankscore','String','GERP++ RS scores were ranked among all GERP++ RS scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of GERP++ RS scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP46way_primate','phyloP46way_primate','String','phyloP (phylogenetic p-values) conservation score based on the multiple alignments of 10 primate genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP46way_primate_rankscore','phyloP46way_primate_rankscore','String','phyloP46way_primate scores were ranked among all phyloP46way_primate scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phyloP46way_primate scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP46way_placental','phyloP46way_placental','String','phyloP (phylogenetic p-values) conservation score based on the multiple alignments of 33 placental mammal genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP46way_placental_rankscore','phyloP46way_placental_rankscore','String','phyloP46way_placental scores were ranked among all phyloP46way_placental scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phyloP46way_placental scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP100way_vertebrate','phyloP100way_vertebrate','String','phyloP (phylogenetic p-values) conservation score based on the multiple alignments of 100 vertebrate genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phyloP100way_vertebrate_rankscore','phyloP100way_vertebrate_rankscore','String','phyloP100way_vertebrate scores were ranked among all phyloP100way_vertebrate scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phyloP100way_vertebrate scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons46way_primate','phastCons46way_primate','String','phastCons conservation score based on the multiple alignments of 10 primate genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons46way_primate_rankscore','phastCons46way_primate_rankscore','String','phastCons46way_primate scores were ranked among all phastCons46way_primate scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phastCons46way_primate scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons46way_placental','phastCons46way_placental','String','phastCons conservation score based on the multiple alignments of 33 placental mammal genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons46way_placental_rankscore','phastCons46way_placental_rankscore','String','phastCons46way_placental scores were ranked among all phastCons46way_placental scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phastCons46way_placental scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons100way_vertebrate','phastCons100way_vertebrate','String','phastCons conservation score based on the multiple alignments of 100 vertebrate genomes (including human). The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.phastCons100way_vertebrate_rankscore','phastCons100way_vertebrate_rankscore','String','phastCons100way_vertebrate scores were ranked among all phastCons100way_vertebrate scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of phastCons100way_vertebrate scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SiPhy_29way_pi','SiPhy_29way_pi','String','The estimated stationary distribution of A, C, G and T at the site, using SiPhy algorithm based on 29 mammals genomes.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SiPhy_29way_logOdds','SiPhy_29way_logOdds','String','SiPhy score based on 29 mammals genomes. The larger the score, the more conserved the site.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.SiPhy_29way_logOdds_rankscore','SiPhy_29way_logOdds_rankscore','String','SiPhy_29way_logOdds scores were ranked among all SiPhy_29way_logOdds scores in dbNSFP. The rankscore is the ratio of the rank of the score over the total number of SiPhy_29way_logOdds scores in dbNSFP.'),
 ('f_0004','va.dbNSFP','va.dbNSFP.LRT_omega','LRT_omega','String','estimated nonsynonymous-to-synonymous-rate ratio (Omega, reported by LRT)'),
 ('f_0004','va.dbNSFP','va.dbNSFP.clinvar_rs','clinvar_rs','String','rs number from the clinvar data set'),
 ('f_0004','va.dbNSFP','va.dbNSFP.clinvar_clinsig','clinvar_clinsig','String','clinical significance as to the clinvar data set 2 - Benign, 3 - Likely benign, 4 - Likely pathogenic, 5 - Pathogenic, 6 - drug response, 7 - histocompatibility. A negative score means the the score is for the ref allele'),
 ('f_0004','va.dbNSFP','va.dbNSFP.clinvar_trait','clinvar_trait','String','the trait/disease the clinvar_clnsig referring to'),
 ('f_0004','va.dbNSFP','va.dbNSFP.clinvar_golden_stars','clinvar_golden_stars','String','ClinVar Review Status summary: 0 - no assertion criteria provided, 1 - criteria provided, single submitter, 2 - criteria provided, multiple submitters, no conflicts, 3 - reviewed by expert panel, 4 - practice guideline'),
 ('f_0004','va.dbNSFP','va.dbNSFP.cosmic_id','cosmic_id','String','ID of the SNV at the COSMIC (Catalogue Of Somatic Mutations In Cancer) database'),
 ('f_0004','va.dbNSFP','va.dbNSFP.cosmic_count','cosmic_count','String','number of samples having this SNV in the COSMIC database'),
 ('f_0004','va.dbNSFP','va.dbNSFP.Polyphen2_HDIV_pred','Polyphen2_HDIV_pred','String','Polyphen2 prediction based on HumDiv, "D" ("porobably damaging", HDIV score in [0.957,1] or rankscore in [0.52996,0.89917]), "P" ("possibly damaging", HDIV score in [0.453,0.956] or rankscore in [0.34412,0.52842]) and "B" ("benign", HDIV score in [0,0.452] or rankscore in [0.02656,0.34399]). Score cutoff for binary classification is 0.5 for HDIV score or 0.35411 for rankscore, i.e. the prediction is "neutral" if the HDIV score is smaller than 0.5 (rankscore is smaller than 0.35411), and "deleterious" if the HDIV score is larger than 0.5 (rankscore is larger than 0.35411). Multiple entries are separated by ";".'),
